import React from "react";
import {Form, Formik} from "formik";
import {Grid, Input} from "@mui/material";
const Signin = () => {
    return (
        <Formik initialValues={{email: "", password:""}}
                onSubmit={(values)=>{
                    console.log(values);
                }}
        >
            <Form>
                <Grid>
                    <Grid item xs={6}>
                        <Input name={"email"} aria-label={"Email"}></Input>
                    </Grid>
                </Grid>

            </Form>
        </Formik>
    )
};
export default Signin;
